// 여기에 코드를 작성하세요
export async function getFoods({ order = "createdAt", offset = 0, limit = 2 }) {
  const query = `order=${order}`;
  const res = await fetch(
    `https://learn.codeit.kr/1111/foods?offset=0&limit=2`
  );
  const body = await res.json();
  return body;
}
